import React, { useEffect, useRef } from "react";
import mapboxgl from "mapbox-gl";
import "mapbox-gl/dist/mapbox-gl.css";

mapboxgl.accessToken =
  "pk.eyJ1IjoibWFwZmVhbiIsImEiOiJjbTNuOGVvN3cxMGxsMmpzNThzc2s3cTJzIn0.1uhX17BCYd65SeQsW1yibA";

const FROST_CLIENT_ID = "12f68031-8ce7-48c7-bc7a-38b843f53711";
const FROST_CLIENT_SECRET = "08a75b8d-ca70-44a9-807d-d79421c082bf";

const WeatherStationsMap = () => {
  const mapContainer = useRef(null);
  const mapRef = useRef(null);

  /**
   * Convert Frost API data into valid GeoJSON
   */
  const frostToGeoJSON = (stations) => {
    const features = stations
      .filter((station) => {
        const coords = station.geometry?.coordinates;
        return (
          coords &&
          Array.isArray(coords) &&
          coords.length === 2 &&
          typeof coords[0] === "number" &&
          typeof coords[1] === "number"
        );
      })
      .map((station) => ({
        type: "Feature",
        geometry: {
          type: "Point",
          coordinates: station.geometry.coordinates,
        },
        properties: {
          id: station.id,
          name: station.name,
          shortName: station.shortName || "Unknown",
          country: station.country || "Norway",
        },
      }));

    console.log(`âœ… Converted ${features.length} valid stations into GeoJSON`);
    return { type: "FeatureCollection", features };
  };

  /**
   * Fetch stations from Frost API
   */
  const fetchStations = async () => {
    try {
      const frostAuth = btoa(`${FROST_CLIENT_ID}:${FROST_CLIENT_SECRET}`);
      console.log("ðŸŒ Fetching stations from Frost API...");

      const response = await fetch(
        "/frost/sources/v0.jsonld?types=SensorSystem",
        {
          headers: {
            Authorization: `Basic ${frostAuth}`,
            Accept: "application/json",
          },
        }
      );

      console.log("ðŸ”„ Response status:", response.status);

      if (!response.ok) {
        throw new Error(`âŒ Frost API error: ${response.status}`);
      }

      const data = await response.json();
      console.log("ðŸ“¦ Frost API raw data:", data);

      if (!data || !Array.isArray(data.data)) {
        console.error("ðŸš¨ Invalid Frost API response format");
        return [];
      }

      return data.data || [];
    } catch (error) {
      console.error("ðŸš¨ Error fetching Frost data:", error);
      return [];
    }
  };

  useEffect(() => {
    const initMap = async () => {
      // Prevent double initialization
      if (mapRef.current) return;

      console.log("ðŸ—ºï¸ Initializing Mapbox map...");

      // Create map instance
      mapRef.current = new mapboxgl.Map({
        container: mapContainer.current,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [10.75, 59.91],
        zoom: 5,
      });

      // Wait until the map has fully loaded
      await new Promise((resolve) => mapRef.current.on("load", resolve));
      console.log("ðŸ›°ï¸ Mapbox map loaded");

      // Fetch station data **after** map is ready
      const stations = await fetchStations();
      console.log(`ðŸ“Š Total stations fetched: ${stations.length}`);

      if (stations.length === 0) {
        console.warn("âš ï¸ No stations returned from Frost API");
        return;
      }

      const geojson = frostToGeoJSON(stations);
      console.log("ðŸŒ GeoJSON ready:", geojson);

      // Use Blob URL to avoid large inline object rejection
      const blob = new Blob([JSON.stringify(geojson)], {
        type: "application/json",
      });
      const url = URL.createObjectURL(blob);

      // Safely add source if it doesn't exist yet
      if (!mapRef.current.getSource("stations")) {
        mapRef.current.addSource("stations", {
          type: "geojson",
          data: url,
        });
      }

      // Safely add layer if it doesn't exist yet
      if (!mapRef.current.getLayer("stations-layer")) {
        mapRef.current.addLayer({
          id: "stations-layer",
          type: "circle",
          source: "stations",
          paint: {
            "circle-radius": [
              "interpolate",
              ["linear"],
              ["zoom"],
              0, 3,
              5, 5,
              10, 8,
              15, 14,
            ],
            "circle-color": "#ff6600",
            "circle-stroke-width": 1,
            "circle-stroke-color": "#fff",
            "circle-opacity": 0.9,
          },
        });
      }

      console.log("âœ… Station layer added successfully");

      // Debug: confirm source presence
      setTimeout(() => {
        const source = mapRef.current.getSource("stations");
        console.log("ðŸ“¡ Stations source object:", source);
        if (!source) {
          console.error("ðŸš¨ Mapbox rejected the GeoJSON source!");
        }
      }, 500);

      // Fit bounds to Norway
      mapRef.current.fitBounds(
        [
          [4, 57],
          [31, 72],
        ],
        { padding: 20 }
      );

      // Interactivity: Popup on click
      mapRef.current.on("click", "stations-layer", (e) => {
        const props = e.features[0].properties;
        const coords = e.features[0].geometry.coordinates;

        new mapboxgl.Popup()
          .setLngLat(coords)
          .setHTML(`
            <strong>${props.name}</strong><br/>
            ID: ${props.id}<br/>
            Country: ${props.country}
          `)
          .addTo(mapRef.current);
      });

      // Change cursor on hover
      mapRef.current.on("mouseenter", "stations-layer", () => {
        mapRef.current.getCanvas().style.cursor = "pointer";
      });
      mapRef.current.on("mouseleave", "stations-layer", () => {
        mapRef.current.getCanvas().style.cursor = "";
      });

      // Catch Mapbox rendering errors explicitly
      mapRef.current.on("error", (e) => {
        console.error("ðŸ›‘ Mapbox rendering error:", e.error);
      });
    };

    initMap();
  }, []);

  return (
    <div
      ref={mapContainer}
      style={{ width: "100%", height: "100vh", borderRadius: "10px" }}
    />
  );
};

export default WeatherStationsMap;
